h AAX’s upcoming products expansion.\r\n\r\nWe like to think of AAB as digital umami – it adds that extra touch, that next-level flavor, that hard-to-define dimension – the missing piece that makes everything taste slightly better.\r\n \r\nIn total, 50 million AAB is to be issued as an ERC-20 token on the Ethereum blockchain, and it will initially be valued at 1 USDT each.','https://assets.coingecko.com/coins/images/11073/thumb/GluwoJk__400x400.jpg?1587969347','https://assets.coingecko.com/coins/images/11073/small/GluwoJk__400x400.jpg?1587969347','https://assets.coingecko.com/coins/images/11073/large/GluwoJk__400x400.jpg?1587969347','2021-03-22 22:10:16'),(34,'abc-chain',0,127743734,NULL,'','https://assets.coingecko.com/coins/images/7481/thumb/logo_%287%29.png?1547717353','https://assets.coingecko.com/coins/images/7481/small/logo_%287%29.png?1547717353','https://assets.coingecko.com/coins/images/7481/large/logo_%287%29.png?1547717353','2021-03-22 22:10:16'),(35,'abcc-token',555845,35,146015625,'ABCC Digital Asset Exchange will issue ABCC Token (AT) on July 9th 2018 (UTC+8) as part of our User Incentive Plan.\r\n\r\n1. What is ABCC Token?\r\n\r\nABCC Token (AT) is an ERC20 Token to be issued by ABCC Digital Asset Exchange. The total supply of AT is fixed at 210 million without any future offering.\r\n\r\n2. Benefits of AT\r\n\r\nAT is a blockchain-based token native to ABCC Digital Asset Exchange. Members holding AT will be able to get access to a wide range of benefits including but not limited to—\r\n\r\nUsing AT for various products and services on ABCC. For example, members can purchase other digital assets, pay transaction fees and gain preferential access to premium services with AT. \r\nParticipating in various activities and campaigns on ABCC. ABCC will reward members who meet certain criteria. For example, members holding AT will share in 80% of trading commissions collected by ABCC.\r\nParticipating in various activities such as community building, interaction between members and ABCC, proposing suggestions to ABCC and others. \r\n3. Initial Allocation\r\n\r\nBelow is a breakdown of the initial allocation of AT.\r\n\r\n4. Issuance\r\n\r\nWe will adopt a mechanism called “Trade Contribution + Simultaneous Release” to issue AT.\r\n\r\n4.1 Trade Contribution\r\n\r\nIn order to encourage our users to trade on ABCC, we have decided to reward our members with 50% of the total supply of AT. \r\n\r\nOf the 50% rewarded to users, 4/5 (i.e. 40% of the total supply) will be used to reward members who trade on our exchange platform via the “Trade-to-Mine” (ToM) mechanism. The other 1/5 (i.e. 10% of the total supply) will be granted to users who traded prior to the issuance of AT.\r\n\r\n4.1.1 Trade-to-Mine (ToM)\r\n\r\n40% of the total supply of AT will be used to reward members who trade on our exchange platform via the “Trade-to-Mine” (ToM) mechanism.\r\n\r\nDrawing inspirations from the Bitcoin mining model, we have adopted a similar inflation model for AT.  In particular, the ToM mechanism includes two steps, i.e., “release” and “distribution”. \r\n\r\nRelease\r\n\r\nThe release of AT follows a half-life decay pattern. There are 6 half-life periods in total with each period being 120 days (roughly 4 months). We will release half of the total supply of AT in the first 120 days. The number of AT to be released in the following half-life period will be halved, and so on. Please see details of AT release schedule below. \r\n\r\nWithin each half-life period, one “block” will be generated every 6 hours. The same number of AT will be released for every block inside the same half-life period. For example, the number of AT to be released for one block in the 1st half-life period is calculated as follows.\r\n\r\nThe total number of AT in the 1st half-life period: 42,000,000;\r\nThe number of days in the 1st half-life period: 120 days;\r\nOne block will be generated every 6 hours;\r\nThe number of blocks to be generated every day: 24 hours / 6 hours = 4;\r\nTherefore, the number of AT to be released for one block in the 1st half-life period: 42,000,000/120 / (24 hours / 6 hours) = 87,500.\r\nDistribution\r\n\r\nWe will distribute AT released in a block to members per the percentage of their trading fees within that block.\r\n\r\nIf it so happens that there are no members eligible for the rewards in a certain block, the released AT assigned to this block will be distributed in the next block.\r\n\r\n4.1.2 Reward for Historical Trades\r\n\r\n10% of the total supply of AT will be used to reward eligible existing users.  We will distribute the rewards to the eligible users based on their cumulative trade volume contribution ending 24:00 June 27th, 2018 (UTC+8). The rewards will be frozen for 180 days after the launch of AT.\r\n\r\n4.2 Simultaneous Release\r\n\r\nAT will be released to the platform, team and investors in proportion to the number of AT released and distributed to members via Trade-to-Mine (ToM).\r\n\r\nThe number of AT released via Simultaneous Release = the number of AT released and distributed via ToM * (50% / 40%).','https://assets.coingecko.com/coins/images/5132/thumb/abcc-token.png?1547040523','https://assets.coingecko.com/coins/images/5132/small/abcc-token.png?1547040523','https://assets.coingecko.com/coins/images/5132/large/abcc-token.png?1547040523','2021-03-22 22:10:16'),(36,'abitshadow-token',3202,0,500000000,'ABST aims to build a virtual reality ecosystem based on blockchain technology to connect virtual reality content, creators and users. VR/AR is recognized as the next-generation general-purpose computing platform. ABST will assume the important task of promoting the virtual reality industrys ecological development and accelerate the advent of the VR/AR era. ABST will solve three major problems in VR applications: trust mechanism, equity distribution and content circulation: The ABST protocol, built on the basis of non-mutability, solves the trust problem in the virtual world and will become the cornerstone of the user relationship in the ABST virtual world. The decentralization setup allows any user to create a reasonable distribution of benefits in the ABST, whether producing contents or providing services; ABST l is a large ecology of virtual reality content. It will stimulate active behavior through unique ecological mechanisms and enhance the circulation of content. ABST is composed of industry elites from the field of virtual reality, while at the same time they are supported by experts and scholars from the blockchain field. ABST has reached strategic partnerships with leading VR companies in the world, and is actively promoting the layout and ecological construction of global virtual reality content.','https://assets.coingecko.com/coins/images/7882/thumb/bjRfWjFv_400x400.jpg?1551316417','https://assets.coingecko.com/coins/images/7882/small/bjRfWjFv_400x400.jpg?1551316417','https://assets.coingecko.com/coins/images/7882/large/bjRfWjFv_400x400.jpg?1551316417','2021-03-22 22:10:16'),(37,'able',120779,5,16350808181,'ABLE is a financial platform of cryptocurrency. ABLE’s P2P loan matching engine and DEX based mutual fund platform solve current tradition banking and investing problem. Blockchain technology enable to connect global investors and entrepreneurs regardless of border in a reliable way.\r\n\r\nThe ABLE project has been proposed to provide an alternative to banks’ conventional lendingdeposit spread structure, and to solve problems with initial cryptocurrency banking services.\r\n\r\nBy developing a matching engine that connects investors and borrowers on a peer-to-peer basis, the project directly connects investors and borrowers without any intermediaries. With intermediaries and lending spreads eliminated, cryptocurrency interest rates will be determined by mutual agreement between users in a free market, and said rates will serve as market interest rates. Investors can receive higher interests than they would in a centralized market, while borrowers can lend money at lower rates, creating a win-win scenario. Since investing and lending occur governed by smart contracts, the project will eliminate exposure to managers’ moral hazard and the risk of central-server hacking.\r\n\r\nCurrent cryptocurrency banking services provide deposits and loans separately rather than linking depositors and borrowers. The services have shortcomings such as inability to provide high deposit interest rates in a sustainable way. Such services cannot mitigate or eliminate intermediary risks because their structure is based on a centralized model. On the other hand, the ABLE project directly links users, primarily through an account, and enables a variety of financial activities such as payroll and investment, based on smart contracts. \r\n\r\nThe ABLE project primarily aims to apply decentralized blockchain technology to financial and wealth management features; to directly link demand and supply through an account on a peer-to-peer basis; and to establish a reliable system. It aims subsequently to build an in-house decentralized exchange, and then to evolve into a platform on which to develop and use smart contracts for finance and wealth management services. ','https://assets.coingecko.com/coins/images/4730/thumb/able.png?1547040033','https://assets.coingecko.com/coins/images/4730/small/able.png?1547040033','https://assets.coingecko.com/coins/images/4730/large/able.png?1547040033','2021-03-22 22:10:18'),(38,'abosom',0,0,100000000,'Abosom is a defiant variant of Retro crypto currency with 100% Premine, decentralised governance and the new BuyBack Burn economic model.\r\n\r\nAbosom is a network that will truly own or control real world assets and possibly move humanity into the era of equity for income..','https://assets.coingecko.com/coins/images/12317/thumb/Abosom_logo_only.png?1599087411','https://assets.coingecko.com/coins/images/12317/small/Abosom_logo_only.png?1599087411','https://assets.coingecko.com/coins/images/12317/large/Abosom_logo_only.png?1599087411','2021-03-22 22:10:18'),(39,'absolute',29560,4,52500000,'Absolute - Proof of Advertisement Views. Our unique Masternode-backed Smartcontracts affords trust in programmatic advertising. Efficiency. Before programmatic ad buying, digital ads were bought and sold by human ad buyers and salespeople, who can be expensive and unreliable. Programmatic advertising technology promises to make the ad buying system more efficient, and therefore cheaper, by removing humans from the process wherever possible. Our Smartcontracts for the first time ever decentralize this system to allow advertisers full trust in the way they spend their budgets.','https://assets.coingecko.com/coins/images/4517/thumb/ABS-Logo-600x600.png?1547039818','https://assets.coingecko.com/coins/images/4517/small/ABS-Logo-600x600.png?1547039818','https://assets.coingecko.com/coins/images/4517/large/ABS-Logo-600x600.png?1547039818','2021-03-22 22:10:18'),(40,'ac-exchange-token',8902673,668923,49614188,'ACXT is the exchange governance token of ACDX, a next-generation cryptocurrency derivatives exchange','https://assets.coingecko.com/coins/images/13293/thumb/ACDX_Original_05.png?1607064933','https://assets.coingecko.com/coins/images/13293/small/ACDX_Original_05.png?1607064933','https://assets.coingecko.com/coins/images/13293/large/ACDX_Original_05.png?1607064933','2021-03-22 22:10:19'),(41,'ac-milan-fan-token',0,2574200,20000000,'','https://assets.coingecko.com/coins/images/13940/thumb/ACM-10.png?1613040443','https://assets.coingecko.com/coins/images/13940/small/ACM-10.png?1613040443','https://assets.coingecko.com/coins/images/13940/large/ACM-10.png?1613040443','2021-03-22 22:10:19'),(42,'acash-coin',0,19,45000000000,'Crypto payment solution project','https://assets.coingecko.com/coins/images/9471/thumb/JxCQN9vthyjwGMcjPHzlYJwcu84LG-l3rFR3zgAOGd6BJTtxFVkmZt5PbUJytMa_RrZvYI5EeVm_vP89viF_hyFxwLGw6LlIkgSk32kGMnIy7o8zDkMBrO0wd-4zC--0Ulz9OUESJUOzy6cwH6xx7s5QbF0U3A3fVL9w4Q_jgcKJeM75iuaRMT8k6IhUq6GPiNe-vAyIjpQJI_407eFSeNyB5FVz7w4h5Lu10fLp5ti0mZZs.jpg?1575586540','https://assets.coingecko.com/coins/images/9471/small/JxCQN9vthyjwGMcjPHzlYJwcu84LG-l3rFR3zgAOGd6BJTtxFVkmZt5PbUJytMa_RrZvYI5EeVm_vP89viF_hyFxwLGw6LlIkgSk32kGMnIy7o8zDkMBrO0wd-4zC--0Ulz9OUESJUOzy6cwH6xx7s5QbF0U3A3fVL9w4Q_jgcKJeM75iuaRMT8k6IhUq6GPiNe-vAyIjpQJI_407eFSeNyB5FVz7w4h5Lu10fLp5ti0mZZs.jpg?1575586540','https://assets.coingecko.com/coins/images/9471/large/JxCQN9vthyjwGMcjPHzlYJwcu84LG-l3rFR3zgAOGd6BJTtxFVkmZt5PbUJytMa_RrZvYI5EeVm_vP89viF_hyFxwLGw6LlIkgSk32kGMnIy7o8zDkMBrO0wd-4zC--0Ulz9OUESJUOzy6cwH6xx7s5QbF0U3A3fVL9w4Q_jgcKJeM75iuaRMT8k6IhUq6GPiNe-vAyIjpQJI_407eFSeNyB5FVz7w4h5Lu10fLp5ti0mZZs.jpg?1575586540','2021-03-22 22:10:20'),(43,'ace-casino',0,94289,2000000000,'ACE is a Hyperconnected Entertainment Coin, an EOS-based utility token that is used directly in the entertainment business carried out by ACE Entertainment LLC, a Georgian company and its ACE Alliance partners or as a token to share the profits of business activities. ACE holders contribute to decision-making and healthy growth of the ACE ecosystem by participating as a member of the ACE token economy system, and in exchange for this, they share the benefits of ecosystem growth. ACE is a utility token at the center of the entertainment ecosystem developed by ACE Entertainment, for direct use in the ACE ecosystem or participation in decision-making on platform operations and sharing profits from ecosystem growth. ACE is used for entertainment services provided by ACE Entertainment and its business partners. And ACE holders can commit ACE to share profits from entertainment service operations ACE can also be used for various entertainment including gaming platforms, mind sports game activities, food and beverages, and retail.','https://assets.coingecko.com/coins/images/9702/thumb/97706665_104962101231887_1710817986622783488_n.png?1592815301','https://assets.coingecko.com/coins/images/9702/small/97706665_104962101231887_1710817986622783488_n.png?1592815301','https://assets.coingecko.com/coins/images/9702/large/97706665_104962101231887_1710817986622783488_n.png?1592815301','2021-03-22 22:10:20'),(44,'aced',1327412,260377,250000000,'AceD coin is a privacy oriented platform. Community driven currency, anyone can create or vote AceD governance proposals. Features include private send and instant payments. Transactions are 100% private and confirm in less than 1 second.','https://assets.coingecko.com/coins/images/4761/thumb/aced.png?1547040086','https://assets.coingecko.com/coins/images/4761/small/aced.png?1547040086','https://assets.coingecko.com/coins/images/4761/large/aced.png?1547040086','2021-03-22 22:10:21'),(45,'achain',14696793,4189416,1000000000,'Achain is a public blockchain platform that enables developers of all levels to issue tokens and create smart contracts, decentralized applications, and blockchain systems. Achain is committed to building a global blockchain network for information exchange and value transactions. Unlike <a href=\"https://www.coingecko.com/en/coins/bitcoin\">Bitcoin</a> or <a href=\"https://www.coingecko.com/en/coins/ethereum\">Ethereum</a>, Achain utilizes a modified version of <a href=\"https://www.coingecko.com/en?hashing_algorithm=Delegated+Proof-of-Stake&view=market\">DPoS</a> — RDPoS (Result-delegated Proof of Stake) to establish node consensus. Shortly, DPoS suggests that all coin holders vote for the validator nodes that will produce the next blocks.\r\n\r\nOn the project website, only info about CEO Tony Cui is listed. Cui has a few significant accomplishments, including winning the Future Star award from the Zhongguancun Alliance and being listed in the 30 under 30 on CYZONE, a famous venture capital magazine. On LinkedIn, 51 people are listed as employees at Achain. Most of the team is based in Beijing. Achain also has a few key industry partners. It has even co-organized a “Blockchain Technology Open Course” with Tsinghua University, which is widely recognized as one of the world’s top universities.\r\n\r\nThe roadmap for Achain development is fairly detailed. However, most goals listed are development-oriented rather than marketing or design. Still, it’s important to note that focusing on making the protocol interoperable and building a technology that is more accessible to mainstream adoption could also be considered a marketing-oriented part of this project. There are three major phases with projected completion dates listed. These include Singularity (completed Q1), Galaxy (ongoing), and Cosmos (complete at the end of Q4). One thing to note is that dates for these phases are not consistent between the homepage and the whitepaper. This could be simply due to a scenario in which phase names remain the same while new goals and timeline dates within those phases continue to change. In January 2019, the project will update the website to reflect roadmap goals for the new year.\r\n\r\nLooking at the current landscape of blockchain projects, Achain certainly offers the possibility of much-needed technical innovations. The ability to easily create an Achain fork, as well as, the protocol’s unique RDPoS consensus algorithm make this a promising project. It will be interesting to see how Achain builds upon its accomplishments, and how the project team continues to develop a long-term strategy for improving the protocol’s technical capabilities and increasing participation in its ecosystem.','https://assets.coingecko.com/coins/images/1147/thumb/achain-logo.png?1547035157','https://assets.coingecko.com/coins/images/1147/small/achain-logo.png?1547035157','https://assets.coingecko.com/coins/images/1147/large/achain-logo.png?1547035157','2021-03-22 22:10:24'),(46,'acoconut',4743603,702598,3276000,'acBTC is a composite asset backed by a basket of ERC20 BTC. The acBTC ecosystem integrates native BTC and ERC20 BTC, with swap, lending and yield generating applications into one highly secure, efficient and usable standard.\r\n\r\nThe AC token serves as the fundamental driver for community governance by incentivizing stakeholders for participation and sound decision making. Ecosystem incentives are designed to compensate users and Governors for their efforts on driving growth, stability and sustainability of the acBTC ecosystem.','https://assets.coingecko.com/coins/images/12779/thumb/ac_logo.png?1602500084','https://assets.coingecko.com/coins/images/12779/small/ac_logo.png?1602500084','https://assets.coingecko.com/coins/images/12779/large/ac_logo.png?1602500084','2021-03-22 22:10:24'),(47,'acoin',0,3,NULL,'Acoin was designed from the ground up and is designed to be a rare currency. There is no premine. Only 800,000 to 1,600,000 coins will be issued (this varies due to the random rewards system). The coin reward starts at 1 and halves every 6 months. One in ten blocks will have a reward that is two to ten times the normal block reward.\r\n','https://assets.coingecko.com/coins/images/172/thumb/acoin.png?1547033900','https://assets.coingecko.com/coins/images/172/small/acoin.png?1547033900','https://assets.coingecko.com/coins/images/172/large/acoin.png?1547033900','2021-03-22 22:10:24'),(48,'acreage-coin',0,222927,1000000000,'Acreage is the intuitive blockchain and future marketplace solution evolving how site surveys are stored and exchanged. It will allow users to utilize ACR as a means to purchase uploaded site surveys that are otherwise lost or discarded.\r\nA marketplace through which surveys are recycled and exchanged from owners to buyers is the inspiration of the Acreage project.','https://assets.coingecko.com/coins/images/5100/thumb/acreage-coin.jpg?1547040494','https://assets.coingecko.com/coins/images/5100/small/acreage-coin.jpg?1547040494','https://assets.coingecko.com/coins/images/5100/large/acreage-coin.jpg?1547040494','2021-03-22 22:10:25'),(49,'acryl',0,0,100000000,'','https://assets.coingecko.com/coins/images/8201/thumb/acryl-2.png?1556504912','https://assets.coingecko.com/coins/images/8201/small/acryl-2.png?1556504912','https://assets.coingecko.com/coins/images/8201/large/acryl-2.png?1556504912','2021-03-22 22:10:25'),(50,'acryptos',34731840,985444,512118,'Yield aggregator on Binance Smart Chain','https://assets.coingecko.com/coins/images/13276/thumb/favicon-200x200.png?1606894442','https://assets.coingecko.com/coins/images/13276/small/favicon-200x200.png?1606894442','https://assets.coingecko.com/coins/images/13276/large/favicon-200x200.png?1606894442','2021-03-22 22:10:25'),(51,'acryptosi',0,42291,54161,'','https://assets.coingecko.com/coins/images/13307/thumb/favicon-200x200.png?1607327420','https://assets.coingecko.com/coins/images/13307/small/favicon-200x200.png?1607327420','https://assets.coingecko.com/coins/images/13307/large/favicon-200x200.png?1607327420','2021-03-22 22:10:26'),(52,'action-coin',0,0,2000000000,'The Action Coin Platform represents over 1 Million Action collectors and customers from more than 200 countries and territories. It is the basis of an incentive-driven rewards program with “points” that are rewarded in the form of a decentralized, blockchain-based digital asset known as Action (“ACTN”). Action may be redeemed for member-only discounts on a growing list of products and services offered through our business network.\r\n\r\nVendors market and sell their products and services through the Action Coin Platform in exchange for Action Coin (“Action” or “ACTN”). It is up to the vendor to determine how much Action they are prepared to accept for their products or services (the suggested rate of exchange for deals on the Action Coin Platform is 1,000 ACTN for every $1 USD in value). They may choose to accept Action Coin for partial payment or full payment, but their choice and their terms of business must be clearly stated and explained within the description of their offer.\r\n\r\nAction Coin (“Action” or “ACTN”) is earned by joining our website, referring friends and family to our platform and participating in community activities. You may also find and collect Action Coin in “Augmented Reality“. Community members may use their Action Coin to obtain deals and discounts on a growing list of products and services offered by Vendors from more than 26 countries. They may also trade their ACTN for other cryptocurrencies, such as Bitcoin (BTC), Ethereum (ETH) and Bitcoin Cash (BCH). The price and liquidity of ACTN is determined on the Open Market.','https://assets.coingecko.com/coins/images/5079/thumb/act.jpg?1548934202','https://assets.coingecko.com/coins/images/5079/small/act.jpg?1548934202','https://assets.coingecko.com/coins/images/5079/large/act.jpg?1548934202','2021-03-22 22:10:26'),(53,'acuity-token',0,27,NULL,'Acuity Token (ACU) is a decentralized, open-source and immutable publication platform that has all the advantages that modern centralized platforms have. It is fully public. It cannot be censored and no one can be prevented from participating. It is fully programmable at every level. It is a protocol for interconnected content apps that empower the individual.','https://assets.coingecko.com/coins/images/12572/thumb/toQKnif__400x400.png?1600845704','https://assets.coingecko.com/coins/images/12572/small/toQKnif__400x400.png?1600845704','https://assets.coingecko.com/coins/images/12572/large/toQKnif__400x400.png?1600845704','2021-03-22 22:10:27'),(54,'acute-angle-cloud',0,8976997,1000000000,'Acute Angle Cloud is a globally distributed IaaS platform, and is designed to be a basic-layer service platform based on blockchain technology which will realize global distributed cloud computing based on Acute Angle PC, Acute Angle Chain and IPFS (Interplanetary File System) (Acute Angle Platform). The Foundation targets to complete the setup of Acute Angle Cloud through Acute Angle Chain, Acute Angle Cloud 1.0 and Acute Angle Cloud 2.0.','https://assets.coingecko.com/coins/images/2577/thumb/acute-angle-cloud.png?1547036708','https://assets.coingecko.com/coins/images/2577/small/acute-angle-cloud.png?1547036708','https://assets.coingecko.com/coins/images/2577/large/acute-angle-cloud.png?1547036708','2021-03-22 22:10:27'),(55,'ad-flex-token',0,1086955,1000000000,'','https://assets.coingecko.com/coins/images/5620/thumb/ad-flex-token.png?1547041485','https://assets.coingecko.com/coins/images/5620/small/ad-flex-token.png?1547041485','https://assets.coingecko.com/coins/images/5620/large/ad-flex-token.png?1547041485','2021-03-22 22:10:27'),(56,'adamant-messenger',1800870,3307,100671565,'\"ADAMANT is a true Blockchain messenger, independent from governments, corporations and even developers. It is possible due to a decentralized network infrastructure, fully open source and run by users.\r\nADM is a utility-token supporting decentralized ADAMANT Messenger infrastructure.\r\nBlockchain offers superior security and privacy, not available for typical P2P and centralized messengers. Also, Blockchain provides new possibilities. Users can store and transfer cryptos In-Chat with full control of private keys, use ADAMANT as 2FA and more.\r\nIn ADAMANT, nobody can control, block, deactivate, restrict or censor accounts. Users take full responsibility for content, messages, media, and goals and intentions of using the Messenger.\r\nADAMANT utilize Fair Delegated Proof-of-Stake consensus, developed in mid 2018. \r\nFirst development steps were made by ADAMANT TECH LABS LP, registered in Ireland. As ADAMANT is decentralized and open source, it is supported and run by community.\r\n\"','https://assets.coingecko.com/coins/images/2372/thumb/adamant.png?1586835505','https://assets.coingecko.com/coins/images/2372/small/adamant.png?1586835505','https://assets.coingecko.com/coins/images/2372/large/adamant.png?1586835505','2021-03-22 22:10:28'),(57,'adappter-token',16833107,2376153,10000000000,'Adappter will provide a solution that helps individuals, companies, sellers, and users coexist with each other for the objective of happiness and profits of all based on the spirit of fairness, sharing, and trust. Also, Adappter will make every effort to increase the value of all members.\r\n\r\nIn January 2018, we expanded our business to “Adappter” service, which provides various blockchain information and live content from “Houjaeki” service, which provides data on favorable factors in real time. Currently, about 50,000 users who have interests in blockchain (including Android and iOS) use the Adappter service.\r\n\r\nADP is Token published by Adappter, operated within the Ethereum platform (ERC20), and used as a key currency in the adapter ecosystem. It can convert AP, which was received as compensation for partner contents, to ADP and it will continue for 20 years. In the future, it will provide real-life payment functions for purchasing goods, items, and products.','https://assets.coingecko.com/coins/images/14203/thumb/logo_on.png?1614909616','https://assets.coingecko.com/coins/images/14203/small/logo_on.png?1614909616','https://assets.coingecko.com/coins/images/14203/large/logo_on.png?1614909616','2021-03-22 22:10:28'),(58,'adbank',3128522,118594,1000000000,'Adbank is a powerful online ad platform built on Ethereum to remove costly middlemen & dramatically reduce the $50 billion problem of ad fraud using advanced AI technology. By using the Adbank platform, publishers can get paid more for their content while charging advertisers less and creating a transparent ecosystem that benefits all key stakeholders in the industry. Existing ad platforms will be able to access cutting edge anti-fraud AI tools through Adbank’s API and powered with ADB tokens.','https://assets.coingecko.com/coins/images/2806/thumb/adbank.png?1547036978','https://assets.coingecko.com/coins/images/2806/small/adbank.png?1547036978','https://assets.coingecko.com/coins/images/2806/large/adbank.png?1547036978','2021-03-22 22:10:28'),(59,'add-xyz-new',0,63450,10366071,'','https://assets.coingecko.com/coins/images/14351/thumb/ADD.jpg?1