sparency for all involved parties. Moreover, AdEx is using its own Layer-2 scaling solution called OUTPACE to facilitate micropayments per impression between its advertisers and publishers, processing more than 2,5 million transactions daily.\r\n\r\nAfter successful beta tests, AdEx Network released the AdEx Platform in 2020 and scaled it to 7,000 registered advertisers and publishers generating more than 70 million monthly impressions. In August 2020 AdEx started incentivized staking and liquidity providing programs for the $ADX token, interacting with the DeFi ecosystem and engaging its community into actively supporting the stability of the AdEx Platform.','https://assets.coingecko.com/coins/images/847/thumb/adex.png?1547034643','https://assets.coingecko.com/coins/images/847/small/adex.png?1547034643','https://assets.coingecko.com/coins/images/847/large/adex.png?1547034643','2021-03-22 22:10:32'),(63,'adioman',0,0,NULL,'ADIOMAN is an electronic cash made with WAVES BLOCKCHAIN controlling its creation and securing exchanges, while concealing the characters of its clients. Crypto-is another way to say \"cryptography\", and cryptography is PC WAVES BLOCKCHAIN utilized for security, concealing data, characters and the sky is the limit from there. Cash essentially signifies \"cash right now being used\". ADIOMAN are a computerized money intended to be faster, less expensive and more solid than our ordinary government provided cash. Rather than confiding in a legislature to make your cash and banks to store, send and get it, clients execute straightforwardly with one another and store their cash themselves. Since individuals can send cash straightforwardly without an agent, exchanges are typically truly reasonable and quick.','https://assets.coingecko.com/coins/images/8240/thumb/adionman.png?1557716351','https://assets.coingecko.com/coins/images/8240/small/adionman.png?1557716351','https://assets.coingecko.com/coins/images/8240/large/adionman.png?1557716351','2021-03-22 22:10:32'),(64,'aditus',118785,45606,1000000000,'Founded by veteran entrepreneurs by luxury and tech, Aditus is the worlds first luxury access platform for crypto-affluents, aiming to connect this new crypto-affluent community with the luxury lifestyle they desire.  Aditus is a platform where crypto-affluents can access Smart Invitations from luxury merchants to enjoy their products, services or establishments in complete privacy. ','https://assets.coingecko.com/coins/images/1867/thumb/adi.png?1514446309','https://assets.coingecko.com/coins/images/1867/small/adi.png?1514446309','https://assets.coingecko.com/coins/images/1867/large/adi.png?1514446309','2021-03-22 22:10:34'),(65,'adshares',1493753,7033,38758203,'Adshares Network is a decentralized, peer-to-peer market for programmatic advertising. Adshares gives advertisers and publishers ability to trade directly without the need for centralized ad exchanges.','https://assets.coingecko.com/coins/images/868/thumb/ads_tr_900.png?1549005693','https://assets.coingecko.com/coins/images/868/small/ads_tr_900.png?1549005693','https://assets.coingecko.com/coins/images/868/large/ads_tr_900.png?1549005693','2021-03-22 22:10:34'),(66,'adtoken',1341705,5796,1000000000,'adChain is a browser agnostic Ethereum based solution for digital advertising that seamlessly integrates with pre-existing RTB and programmatic industry standards','https://assets.coingecko.com/coins/images/778/thumb/adtoken.png?1547034537','https://assets.coingecko.com/coins/images/778/small/adtoken.png?1547034537','https://assets.coingecko.com/coins/images/778/large/adtoken.png?1547034537','2021-03-22 22:10:34'),(67,'advanced-internet-block',189803,13945,31415926536,'Advanced Internet Blocks (AIB) describes itself as a dual value multi-asset block-chain forked from Bitcoin and Litecoin with merge-mining enabled.','https://assets.coingecko.com/coins/images/1337/thumb/AIB_logo.png?1550458467','https://assets.coingecko.com/coins/images/1337/small/AIB_logo.png?1550458467','https://assets.coingecko.com/coins/images/1337/large/AIB_logo.png?1550458467','2021-03-22 22:10:35'),(68,'adventure-token',1363881,6141,100112825,'WHAT IS ADVENTURE TOKEN?\r\nTWA Adventure Token is a deflationary community token. \r\n\r\nEvery time Adventure Token is purchased, sold or transferred between wallets one percent of the total transaction value is burnt, meaning that with every trade Adventure Token becomes scarcer. Trading attracts liquidity, which in-turn attracts further trading. Liquidity grows and the supply of Adventure Token decreases with every trade.\r\n\r\nHolding Adventure Token also gives you the opportunity to earn further rewards in the Adventure Luna Fund.','https://assets.coingecko.com/coins/images/13284/thumb/twa_logo.jpg?1606979012','https://assets.coingecko.com/coins/images/13284/small/twa_logo.jpg?1606979012','https://assets.coingecko.com/coins/images/13284/large/twa_logo.jpg?1606979012','2021-03-22 22:10:35'),(69,'advertise-coin',0,7939,50000000,'Advertise Exchange connects publishers and advertisers in a crypto world. The ADCO serviced marketplace includes easy cryptocurrency payments, which makes business truly efficient, transparent, and reliable. Advertise Coin has its own ecosystem with several major advertising companies. Our focus is to integrate all companies, employees, and businesses on the advertising market. Our platform allows advertising companies to contact the API database directly, and offers consumers to use much lower prices for services in the advertising market.','https://assets.coingecko.com/coins/images/14344/thumb/advertisecoin200x200.png?1615503478','https://assets.coingecko.com/coins/images/14344/small/advertisecoin200x200.png?1615503478','https://assets.coingecko.com/coins/images/14344/large/advertisecoin200x200.png?1615503478','2021-03-22 22:10:36'),(70,'advertisingcoin',0,0,60000000,'ADVC is a decentralized cryptocurrency based on Ethereum. The coin will become the main means of payment in a number of our online projects, which will further form a technological ecosystem. \r\nThe key development object is the international advertising platform Ad-country, which will allow businessmen to advertise their products and services to a solvent audience. Moreover, each owner of the ADVC cryptocurrency will receive a passive income due to the work of the platform. Up to 50% of the profits from the project will be reserved and monthly distributed among the owners of ADVC in proportion to the number of coins on your balance. The launch of the project will take place in August 2019.	\r\nAt the end of 2019, the launch of a site for the exchange of fiat money and cryptocurrency is also planned. ADVC owners will be able to save up to 70% on paying currency exchange fees. Our coin is already represented on the CREX24 cryptocurrency exchange and has demand there. We managed to achieve a positive dynamics of ADVC due to the partnership with online advertising services that provide our customers with the opportunity to use our cryptocurrency for the transactions.','https://assets.coingecko.com/coins/images/8663/thumb/mB6sbPrt_400x400.png?1560158327','https://assets.coingecko.com/coins/images/8663/small/mB6sbPrt_400x400.png?1560158327','https://assets.coingecko.com/coins/images/8663/large/mB6sbPrt_400x400.png?1560158327','2021-03-22 22:10:36'),(71,'adzcoin',151539,0,84000000,'Adzcoin is a cryptocurrency created to help solve the problem of ad-blocking software reducing revenue for website owners. Adzcoin work by having website owners install a code to detect ad-blockers and replace advertisements with an Adzcoin widget instead where the website visitor, with a single click, can support the website by donating Adzcoin to the website owner.','https://assets.coingecko.com/coins/images/418/thumb/adzcoin.png?1547034135','https://assets.coingecko.com/coins/images/418/small/adzcoin.png?1547034135','https://assets.coingecko.com/coins/images/418/large/adzcoin.png?1547034135','2021-03-22 22:10:38'),(72,'aedart-network',0,64,245857,'AEDART is a community-driven project which has a deflationary mechanism. AEDART will make a difference in the current DeFi space, BSC needs an Independent community token which is able to execute the wishes of the community. Holders of AEDART tokens unlock a variety of benefits, including Public Chat Group, Earning Tokens, Direct Consulting Access, Trading Lessons','https://assets.coingecko.com/coins/images/13103/thumb/Logo_200x200.png?1605232881','https://assets.coingecko.com/coins/images/13103/small/Logo_200x200.png?1605232881','https://assets.coingecko.com/coins/images/13103/large/Logo_200x200.png?1605232881','2021-03-22 22:10:38'),(73,'aegis',531074,473665,30000000,'Aegis is a scalable DeFi platform that solves this problem by giving users access to lending and unsecured borrowing services, based on their credit scores. An \"Aegis Score\" is then assigned to the individual users, which allows users to unlock corresponding capital loans in the crypto ecosystem. Aegis therefore plays the critical role of a capital bridge that gives users the ability to leverage and move liquidity seamlessly between fiat and crypto ecosystems.','https://assets.coingecko.com/coins/images/12391/thumb/logo-3.png?1599540071','https://assets.coingecko.com/coins/images/12391/small/logo-3.png?1599540071','https://assets.coingecko.com/coins/images/12391/large/logo-3.png?1599540071','2021-03-22 22:10:39'),(74,'aelf',162274006,118100193,880000000,'Aelf is the versatile business blockchain platform powered by cloud computing and the central nervous system for businesses, transforming the way they deliver their services. By laying out the fundamental blockchain infrastructure, Aelf enables businesses to focus on building up their own dapps on their own chains with minimum effort. Acting as the master key, Aelf unlocks the potential for inter-business communication and collaboration using cross-chain efficiency. Incorporating modern technologies such as cloud nodes and parallel processing, Aelf is the blockchain system that achieves secure transactions at commercial scale.\r\n\r\nAelf is one of the cryptocurrencies that is attracting crypto enthusiasts following its massive commercial adoption initiative. The coin seems to be leading on the technology front with higher blockchain efficiency, which is why its also anticipated to be the Linux of Blockchains. aelf is an operating system for blockchains which can be customized by their respective users. Its cryptocurrency is denoted by the symbol ELF, with a total supply of 250 million ELF. It was launched on 21 December, 2017 on multiple exchanges in China without any ICO and instead got private investors on board. This ensured better compliance as KYC was done for all investors with most of them being accredited, with a good track record in token investment.\r\n\r\nAelf was developed by Ma Haobao, who is also the CEO of Hoopox. The team is backed by a strong advisory board which includes Michael Arrington (CEO of TechCrunch and founding partner of FGB Capital). The team says it is working on unleashing the blockchain’s potential into mass applications and industries. aelf is now working with Innovation Alliance for increasing the acceptability of blockchain technology which will ultimately increase adoption of aelf’s blockchain. The team is focussed to develop aelf to improve other chains in the ecosystem by providing a template and infrastructure for interaction between the sidechains.\r\n\r\nAelf also has a rewards system – Candy. With the Candy rewards system, you earn points, convertible for ELF, by accomplishing simple, daily tasks. Tasks include liking and replying to aelf tweets, inviting people to the Telegram channel, and other promotional activities. ELF are currently ERC20 tokens. As such, you can store them in any wallet with ERC20 support like MyEtherWallet or Exodus. The Ledger Nano S is also a great option if you’re interested in additional security. \r\n\r\nAelf is a relatively new competitor in the dapp platform race but already has solid support from large investment capital firms. The project is utilizing resource separation through side chains and a unique governance model to build an entire blockchain operating system.','https://assets.coingecko.com/coins/images/1371/thumb/aelf-logo.png?1547035397','https://assets.coingecko.com/coins/images/1371/small/aelf-logo.png?1547035397','https://assets.coingecko.com/coins/images/1371/large/aelf-logo.png?1547035397','2021-03-22 22:10:39'),(75,'aelysir',0,7376,210000000,'We bring the right people together to challenge established thinking and drive transformation. We will show the way to successive.','https://assets.coingecko.com/coins/images/12955/thumb/ael_logo.png?1603794538','https://assets.coingecko.com/coins/images/12955/small/ael_logo.png?1603794538','https://assets.coingecko.com/coins/images/12955/large/ael_logo.png?1603794538','2021-03-22 22:10:40'),(76,'aergo',74400289,9067831,500000000,'AERGO is an open platform that allows businesses to build innovative applications and services by sharing data on a trustless and distributed IT ecosystem. With the ability to deploy on either public or private blockchain networks, AERGO gives businesses the flexibility in developing and deploying blockchain applications with unparalleled speed, scalability and performance. AERGO is designed as a flexible, plugin-based smart contract infrastructure. Client-actors can execute smart contracts written for the Ethereum Virtual Machine or AergoSQL. The AERGO network will be backboned by github-like public and permissioned repositories of Distributed Directories (DD). Implementing Smart Oracles, AERGO will also allow smart contracts to consume data with external services or internal databases and trigger events.','https://assets.coingecko.com/coins/images/4490/thumb/Aergo.png?1558084282','https://assets.coingecko.com/coins/images/4490/small/Aergo.png?1558084282','https://assets.coingecko.com/coins/images/4490/large/Aergo.png?1558084282','2021-03-22 22:11:02'),(77,'aeron',2188523,90027,180452171,'According to its whitepaper, Aeron aims to be the new standard of aviation safety powered by the blockchain. Maintained by a group of aviation professionals, Aeron wants to reduce air transport-related accidents, which it says currently numbers around 3302 per year. One of the major causes of such accidents is the lack of real experience among pilots, since unsecured flight log data from them is susceptible to fraud and forgery. Also, due to \"pay to fly\" experiences, corrupt flight schools, negligence of aircraft operators, the primary data driving any decision is affected.\r\n\r\nAeron is built upon a robust and cryptographically secure database that makes it unique compared to other online travel companies, travel search services or internal applications made for flight officials. With this technology, falsification of data can be kept at a minimum. Additionally, as you would expect from a blockchain-backed application, key information is safely stored and is accessible to everyone with 100% transparency. Except that it now comes secured by a multi-sig authentication system that prevents any type of security breach. According to Aerons Whitepaper, \"The pilot’s application is used by a pilot for personal flight logging. The company application collects and verifies data from aircraft operators, maintenance organizations, flight schools and fixed base operators\".\r\n\r\nAeron (ARN) is an ERC20 compliant <a href=\"https://www.coingecko.com/en/coins/ethereum\">Ethereum</a> based token, with a fixed supply of 20,000,000 ARN. When the token was launched, a fixed amount of tokens were created and after which no more tokens are to be minted. About 60% of the supply is estimated to be in circulation. The supply should decrease over time when ARN tokens as taken out of circulation. Once Aeron receives ARN tokens in exchange of services, the coins will be again released in to the network.\r\n\r\nAccording to its whitepaper, Aeron plans to have a user base of 300000 by the end of 2020. This would encourage it to embed new features on its platform.\r\nWith the help of multi-app functionality and block technology, the company envisions to have an “airline in the pocket” of sorts within two years. While its price has fluctuated like most other cryptocurrencies, it delivered more than 15x returns within a short period between November 2017 to January 2018. As of July 2018, the price is nearly back to its November levels, at $0.57.','https://assets.coingecko.com/coins/images/1124/thumb/ARNX-token-logo-256x256.png?1602652111','https://assets.coingecko.com/coins/images/1124/small/ARNX-token-logo-256x256.png?1602652111','https://assets.coingecko.com/coins/images/1124/large/ARNX-token-logo-256x256.png?1602652111','2021-03-22 22:12:03'),(78,'aerotoken',21516,6,500039,'Aerotoken is an inflationary token operating on the Ethereum blockchain. ','https://assets.coingecko.com/coins/images/9772/thumb/sVM73x16_400x400.jpg?1571707385','https://assets.coingecko.com/coins/images/9772/small/sVM73x16_400x400.jpg?1571707385','https://assets.coingecko.com/coins/images/9772/large/sVM73x16_400x400.jpg?1571707385','2021-03-22 22:12:03'),(79,'aeryus',217,0,50000000,'Aeryus is the first complete, non-fungible blockchain transactional network, for all digital currencies. A fully integrated ecosystem from easy-to-use smartphone app to merchant-friendly PoS terminals. Peer to peer, B2B, B2C and C2C. Aeryus. Discover. Disrupt. Decentralize.','https://assets.coingecko.com/coins/images/8626/thumb/aerlogo.png.jpeg?1559773242','https://assets.coingecko.com/coins/images/8626/small/aerlogo.png.jpeg?1559773242','https://assets.coingecko.com/coins/images/8626/large/aerlogo.png.jpeg?1559773242','2021-03-22 22:12:04'),(80,'aeternity',70247046,18834409,536306702,'æternity is a public, open-source blockchain protocol that enables a platform for next-generation decentralized applications with high scalability. Its core components are written in the functional programming language Erlang and its smart contract language - Sophia - is also functional. æternity has a stellar team of developers including Robert Virding - co-creator of Erlang, John Hughes - co-designer of Haskell, and Ulf Norell - co-designer of the Agda programming language for formal verification.\r\n\r\nUnlike other blockchain platforms, the æternity protocol itself incorporates a number of essential technological features. State channels for off-chain scaling, oracles for real-world information, and a naming system for increased user-friendliness are all implemented on Layer 1. æternity also features SDKs in Javascript, GO, Phyton, Java, as well as a middleware and a development suite that streamline smart contract development.\r\n\r\næternity incorporates the Bitcoin-NG consensus algorithm developed by academics from Cornell University and uses the Cuckoo Cycle mining algorithm for Sybil attack protection.\r\n\r\nAE tokens, the native cryptocurrency of the æternity platform, is used for both - an economic unit of account and as ballots in the community-driven on-chain governance votes.','https://assets.coingecko.com/coins/images/1091/thumb/aeternity.png?1547035060','https://assets.coingecko.com/coins/images/1091/small/aeternity.png?1547035060','https://assets.coingecko.com/coins/images/1091/large/aeternity.png?1547035060','2021-03-22 22:12:04'),(81,'aeur',0,0,10000000,'AEUR is pegged to EUR coin on 1:1 basis, running as separate AEUR child chain on Ardor platform.','https://assets.coingecko.com/coins/images/7811/thumb/fpboa2ok_400x400.jpg?1550776818','https://assets.coingecko.com/coins/images/7811/small/fpboa2ok_400x400.jpg?1550776818','https://assets.coingecko.com/coins/images/7811/large/fpboa2ok_400x400.jpg?1550776818','2021-03-22 22:12:05'),(82,'aevo',0,3,425000000,'A community POS/POW/MN coin with a rewarding masternode system','https://assets.coing