/a> is a lighter supplement to <a href=\"https://www.coingecko.com/en/coins/bitcoin\">Bitcoin</a>, you can look at Aeon as <a href=\"https://www.coingecko.com/en/coins/monero\">Monero’s</a> little brother. The Monero community is wholly focused on privacy and anonymity for the end-user. This focus has its perks but has caused the coin to fall behind from a usability standpoint. Aeon builds upon Monero’s CryptoNote hash while adding some lightweight functionality of its own.\r\n\r\nAeon is the lighter, faster version of Monero. Although both projects share the same underlying privacy protocol, CryptoNote, Aeon is striving to be more accessible. The project is doing so by implementing a lightweight mining algorithm, smaller blockchain, and optional anonymity. As Monero grows, Aeon could very well grow with it. While you would use Monero for transactions in which you want to assure privacy, you may find Aeon to be a suitable substitute for day-to-day exchanges in which guaranteed anonymity isn’t as important.','https://assets.coingecko.com/coins/images/321/thumb/aeon.png?1547034084','https://assets.coingecko.com/coins/images/321/small/aeon.png?1547034084','https://assets.coingecko.com/coins/images/321/large/aeon.png?1547034084','2021-03-22 22:12:35'),(90,'afrodex-labs-token',0,0,1000000000000000,'AfroDex Labs is a corporation which serves as a blockchain tech, launchpad, incubator  & accelerator focused on developing & deploying free or affordable technologies for easier Ethereum & ERC-20 tokens mass adoption.','https://assets.coingecko.com/coins/images/9908/thumb/GOLDEN_TOKEN_4.png?1575868746','https://assets.coingecko.com/coins/images/9908/small/GOLDEN_TOKEN_4.png?1575868746','https://assets.coingecko.com/coins/images/9908/large/GOLDEN_TOKEN_4.png?1575868746','2021-03-22 22:12:36'),(91,'aga-rewards',0,794147,NULL,'EDCOIN is a community governance token built on the ethereum blockchain and provides visible utility and real-time use cases for the entire EDMARK multi-product and real-estate development ecosystem.\r\n\r\nIt is a DeFi platform focusing on Staking, Lending, and Governance. EDCOIN aims to gives financial control back to the people to store and grow wealth together.\r\n\r\nEDCOIN is the future of Decentralized Finance! ','https://assets.coingecko.com/coins/images/13872/thumb/EDCOIN-1.png?1612447671','https://assets.coingecko.com/coins/images/13872/small/EDCOIN-1.png?1612447671','https://assets.coingecko.com/coins/images/13872/large/EDCOIN-1.png?1612447671','2021-03-22 22:12:36'),(92,'aga-rewards-2',0,158579,21988,'AGAr is soft tethered to mining revenue from AGA Mining based in eastern Washington. The mine currently generates six figures of monthly revenue which rewards holders of AGAr through weekly buybacks and burns. ','https://assets.coingecko.com/coins/images/14207/thumb/AR256.png?1614931200','https://assets.coingecko.com/coins/images/14207/small/AR256.png?1614931200','https://assets.coingecko.com/coins/images/14207/large/AR256.png?1614931200','2021-03-22 22:12:38'),(93,'aga-token',58630239,411494,10900000,'','https://assets.coingecko.com/coins/images/12180/thumb/aga-logo.png?1597937396','https://assets.coingecko.com/coins/images/12180/small/aga-logo.png?1597937396','https://assets.coingecko.com/coins/images/12180/large/aga-logo.png?1597937396','2021-03-22 22:12:39'),(94,'agave-token',31431285,1148528,100000,'Agave, a decentralized non-custodial money market protocol where users can participate by borrowing or lending money through the application.','https://assets.coingecko.com/coins/images/14146/thumb/agve.png?1614659384','https://assets.coingecko.com/coins/images/14146/small/agve.png?1614659384','https://assets.coingecko.com/coins/images/14146/large/agve.png?1614659384','2021-03-22 22:12:39'),(95,'agavecoin',0,21836,35000000000,'The AgaveCoin token (AGVC) is a 100% security token to participate and support the multimillionaire business of Agave Industry.  Agave is a succulent genus within the monocot family Agavaceae. The plants have a large rosette of thick fleshy leaves, each ending generally in a sharp point, and are native to arid and semi-arid regions from the southern USA to northern South America. The most important commercial species is Agave tequilana grown for production of tequila. Other Agave species has great potential to be developed as a bioenergy crop, bioplastic, cosmetics and medical products.\r\n\r\nAgaveCoin SAPI, it´s a Mexican industrial company that aims to become a worldwide reference producer of Agave and Agave based Products. More than being just a Agave provider,  AgaveCoin will revolutionize the Agave market by introducing his own Agave crypto currency. ','https://assets.coingecko.com/coins/images/7056/thumb/G4TML4cb_400x400.jpg?1547043511','https://assets.coingecko.com/coins/images/7056/small/G4TML4cb_400x400.jpg?1547043511','https://assets.coingecko.com/coins/images/7056/large/G4TML4cb_400x400.jpg?1547043511','2021-03-22 22:12:40'),(96,'agetron',0,0,284000000,'Agetron treats the all-important blockchain ledger, a fully verifiable public database thats maintained by thousands of independent computers , as a platform on which to build secondary programs that strip out costly middleman from all forms of person to exchange. Agetron enables smart contracts that function without lawyers; stock exchanges without central clearing houses; financial record-keeping systems that can be verified without an auditor; even tamper-proof voting systems that automaticly guarantee one-person-one-vote.\r\n\r\nAgetron is how the internet was supposed to work. AGET proposes a global distributed computer that is the backbone for asset trading, real estate transactions escrow services and even national income distribution systems. Agetron runs smart contracts: Applications that runs as programmed without any possibilitiy of downtime, censorship, fraud or third party interference. Agetron uses the network to transact and for storage. Agetron provides a once in a lifetime opportunity, evolutionizing the digital economy by harnessing the power of an already established blockchain to boost security. Agetrons multi signatures are entirely unbreakable, enforceable, and completely secure and simultaneously gives equal rights to both parties involved in the transaction.','https://assets.coingecko.com/coins/images/3982/thumb/agt_black_fb.png?1547039040','https://assets.coingecko.com/coins/images/3982/small/agt_black_fb.png?1547039040','https://assets.coingecko.com/coins/images/3982/large/agt_black_fb.png?1547039040','2021-03-22 22:12:41'),(97,'agoras',0,96585,42000000,'Agoras is an application over Tau-Chain, being first and foremost a smart currency offering predictable and verifiable contracts, and will offer several markets.\r\n\r\nAGORAS CODE-FOR-MONEY MARKET\r\nEliminating the trust problem between programmers and entities who hire them. Can publish a smart contract that whoever supplies a code with a proof that it meets given requirements, wins coins automatically. Thanks to Tau language, such proofs can be trusted.\r\n\r\nCOMPUTATIONAL RESOURCES MARKET\r\nEveryone will be able to rent out their computational resources (CPU, GPU, Disk) and get paid for it. Lack of many computers is a major bottleneck in many fields (especially medicine design) and cloud/supercomputing companies cannot compete with the higher quantity and lower cost that home computers can offer.\r\n\r\nDECENTRALIZED SMART SEARCH ENGINE\r\nWith large enough network, Tau can crawl the web overnight. We will have a self-incentivizing search engine such that the data is shared by everyone and supporting nodes get paid.\r\n\r\nAgoras will allow smart contracts, that you can know their consequences beforehand. That thanks to the decidability of Tau-Chain.s language. Will also support true peer-to-peer contracts: business that need a private arena, can take place between two Agoras clients.\r\n\r\nAgoras smart currency is on presale now. There is a total amount of 42,000,000 intermediate coins (IDNI Agoras Tokens), that represent 100% of future Agoras coins.\r\nStarting from 01/05/2016 the price of one IDNI Agoras Tokens will be 20 cents (USD), going up 5% monthly.\r\nPremine for long-term development and 3rd party partners is 3%.\r\nAll unsold coins up to Agoras. genesis will be destroyed. For example, if you hold 1% out of 42M coins, and only 21M are sold, then with the actual Agoras coins you will hold a fraction of 2% out of all coins.','https://assets.coingecko.com/coins/images/399/thumb/Agoras.png?1614680577','https://assets.coingecko.com/coins/images/399/small/Agoras.png?1614680577','https://assets.coingecko.com/coins/images/399/large/Agoras.png?1614680577','2021-03-22 22:12:41'),(98,'agouti',9862,0,3000000,'Agouti (AGU) is a charity-based cryptocurrency, designed to give resources to others through blockchain technology. It started as a coin swap from Lunique (LUQ), a cryptocurrency scam.\r\nAgouti – A rebirth of cryptocurrency powered by the dream of decentralized help.','https://assets.coingecko.com/coins/images/6321/thumb/cropped-agouti-logo-650x650.png?1547042393','https://assets.coingecko.com/coins/images/6321/small/cropped-agouti-logo-650x650.png?1547042393','https://assets.coingecko.com/coins/images/6321/large/cropped-agouti-logo-650x650.png?1547042393','2021-03-22 22:12:44'),(99,'agrello',14019371,1514836,130271020,'Agrello develops an AI powered interface, allowing you to easily create and manage smart-contract-based agreements which are legally binding, just like traditional contracts. Agrello is highly end-user oriented and enables anyone to create smart-contracts. No coding or legal skills required.','https://assets.coingecko.com/coins/images/900/thumb/Agrello.png?1558084369','https://assets.coingecko.com/coins/images/900/small/Agrello.png?1558084369','https://assets.coingecko.com/coins/images/900/large/Agrello.png?1558084369','2021-03-22 22:12:44'),(100,'agricoin',0,252,50000000,'Agricoin (AGN) promotes further