tion of this projects includes:\r\n\r\n1. A simple conclusion of transactions by the use of smart-contracts and an ultimate execution;\r\n2. Efficient and economic benefits to all trading participants within the trading transactions;\r\n3. Secured and transparent transactions on the basis of blockchain and all its members.\r\n\r\nThe making this project was as a result of our experience in the market of international trade in products of agriculture and food stuffs. We have made all our businesses processes rational such as finance, logistics, storage, insurance. After testing all similar platforms, we have concluded that the majority of them offer services of the local nature and are not meant for real trading and getting real results, instead they are only informative. We give a critical solution in the global trade. It will allow both small and medium sized manufactures and buyers to reach mutually beneficial deals from all over the world. In addition to that we guarantee payment security by the use of smart contracts; delivering all goods to their destinations safely','https://assets.coingecko.com/coins/images/4464/thumb/aglt.png?1547039784','https://assets.coingecko.com/coins/images/4464/small/aglt.png?1547039784','https://assets.coingecko.com/coins/images/4464/large/aglt.png?1547039784','2021-03-22 22:12:45'),(104,'ahatoken',0,68919402,NULL,'Aha is a knowledge Q&A platform where users can get their questions answered by experts in various fields. Users can acquire digital assets by posting questions, answers, and other content curation activities, which can generate additional profits. Aha also solves abusive activities such as unwanted advertising and P.R. content. Aha creates knowledge content that guarantees reliability and expertise','https://assets.coingecko.com/coins/images/12158/thumb/wNvPf1wZ_400x400.jpg?1597703442','https://assets.coingecko.com/coins/images/12158/small/wNvPf1wZ_400x400.jpg?1597703442','https://assets.coingecko.com/coins/images/12158/l