lt-in wallet to store and donate easily, an explorer to track donations transparently, tools to connect donors with all the actors involved in the non-profit sector and templates of smart contracts to run fundraising campaigns.','https://assets.coingecko.com/coins/images/2144/thumb/aid.png?1547036449','https://assets.coingecko.com/coins/images/2144/small/aid.png?1547036449','https://assets.coingecko.com/coins/images/2144/large/aid.png?1547036449','2021-03-22 22:12:49'),(114,'aidos-kuneen',0,1135070,25000000,'The technology stack of Aidos enables users to spend their tokens freely without any fear of being tracked or tainted. Even though the design differs from existing heavy and complex blockchain like Bitcoin and other crypto-currencies, Aidos still remains the core principles of openness, decentralization and improved privacy. Aidos will also be ready to be used with and plugged into Internet of Things, enabling participation in an ecosystem of billions of devices.','https://assets.coingecko.com/coins/images/6077/thumb/Logoldpi.png?1600764971','https://assets.coingecko.com/coins/images/6077/small/Logoldpi.png?1600764971','https://assets.coingecko.com/coins/images/6077/large/Logoldpi.png?1600764971','2021-03-22 22:12:50'),(115,'aidus',0,1421,10000000000,'Our Project Brief Introduction.\r\nThe AIDUS Global D-Fund Platform is a decentralized fund market established upon the ETHEREUM network to serve as a professional asset management platform in which global investors and asset management companies are able to use Blockchain technologies and SMART Contracts to safely and transparently create and settle into P2P (Peer-to-Peer) fund agreements. Various information regarding the settled fund agreements shall be registered in the Blockchain network and shall continuously be updated through the Oracles* Agent.\r\n\r\nProject Position.\r\nOur core technology development has been completed and verification work has been completed.\r\nThe second phase of the entire PLATFORM development process will begin in November.','https://assets.coingecko.com/coins/images/7432/thumb/LKOt-PQ6_400x400.jpg?1571193797','https://assets.coingecko.com/coins/images/7432/small/LKOt-PQ6_400x400.jpg?1571193797','https://assets.coingecko.com/coins/images/7432/large/LKOt-PQ6_400x400.jpg?1571193797','2021-03-22 22:12:50'),(116,'ailink-token',454378,4388,10000000000,'AiLink is a trusted user-friendly open social platform based on blockchain. In AiLink Ecology, the users behavior data will be recorded on the node of blockchain, which can not be tampered with, and the transaction behaviors of participants in all social networks are realized and constrained by smart contract technology. Under the premise of ensuring the privacy of users, anyone can depict the users digital portraits through the data on the blockchain, and determine whether the person is credible by the blockchain score, thereby greatly reduce the trust cost between people and build a highly trusted ecosystem. \r\n\r\nOn the basis of trust, AiLink will directly break through six degrees of separation. Users can directly connect to or conclude transactions with any node on the network at a low cost, so that information and value can be effectively spread throughout the blockchain network. Then, publishers will achieve their goals, communicators will get token rewards, benefiting all nodes spread throughout the network. \r\n\r\nIn addition, AiLink capture and process massive users open data on blockchain networks with AI operations, design unique formulas, match users with high affinity, to achieve the desired results, such as in the same crowd of music lovers, the probability of the person matching the music preferences matches is higher depending on the users preference for the genre of music. The frequency of interaction between users will also be used to calculate friends degree, so as to continuously improve the relationship between friends. \r\n\r\nAt the same time, AiLink will provide more user-friendly applications, AiLink will start with social games, let users get the concept and value of blockchain more simply and directly, then improve the entire social ecosystem gradually. ','https://assets.coingecko.com/coins/images/5917/thumb/ailink-token.png?1547041855','https://assets.coingecko.com/coins/images/5917/small/ailink-token.png?1547041855','https://assets.coingecko.com/coins/images/5917/large/ailink-token.png?1547041855','2021-03-22 22:12:51'),(117,'aion',118024025,16188407,487496874,'Aion is a revolutionary multi-tier blockchain platform that has been created to solve the pressing issue of limited operability between existing blockchains while still remaining capable of handling its own applications. It supports custom blockchain architectures, and it provides cross-chain interoperability. The Aion project comes at a very appropriate period, in a time where there’s an ever-growing number of blockchains.Thus, interoperability is more important now that it ever has been. Interoperability will expand the horizons of multiple other blockchain platforms, not to mention those of enterprise-oriented companies.\r\n\r\nThe project is led by Matthew Spoke, the CEO of Nuco and board member on the EEA. Other big names include Jin Tu, Nuco’s CTO, who has more than 15 years of experience in enterprise engineering and more than four years in the blockchain industry, and Peter Vessenes who has co-founded the Bitcoin Foundation.\r\n\r\nThe token is the blockchain’s power-source. It’s used for securing the network, for creating new blockchains, as well as for monetizing inter-chain bridges. AION token is actually an ERC-20 token. In fact, the token is first offered as an ERC-20 token on the <a href=\"https://www.coingecko.com/en?asset_platform_id=279&view=market\">Ethereum blockchain</a>, and only then it can be changed to the official AION network token. When that happens, the token can freely stream between two blockchains. The best thing about this is that investors are not required to change their Aion Ethereum token (ERC-20) for the Aion-1 token, as they will always be interchangeable.\r\n\r\nIn order to buy AION, you will need to first purchase another cryptocurrency, preferably <a href=\"https://www.coingecko.com/en/coins/bitcoin\">Bitcoin</a> or <a href=\"https://www.coingecko.com/en/coins/ethereum\">Ethereum</a>. Fortunately, AION is supported by some very popular crypto exchanges out there such as <a href=\"https://www.coingecko.com/en/exchanges/bitforex\">BitForex</a>, <a href=\"https://www.coingecko.com/en/exchanges/binance\">Binance</a>, <a href=\"https://www.coingecko.com/en/exchanges/ethfinex\">Ethfinex</a>, <a href=\"https://www.coingecko.com/en/exchanges/liqui\">Liqui</a>, and <a href=\"https://www.coingecko.com/en/exchanges/bancor\">Bancor Network</a>. Theres a good chance that Aion, with its unique approach of solving interoperability issues, will become somewhat of a necessity for the cryptosphere in the following period.','https://assets.coingecko.com/coins/images/1023/thumb/Aion_Currency_Symbol_Transparent_PNG.png?1575876687','https://assets.coingecko.com/coins/images/1023/small/Aion_Currency_Symbol_Transparent_PNG.png?1575876687','https://assets.coingecko.com/coins/images/1023/large/Aion_Currency_Symbol_Transparent_PNG.png?1575876687','2021-03-22 22:12:51'),(118,'airbloc-protocol',10334582,466325,400000000,'Airbloc Protocol redefines how data is collected, monetized and utilized. Leveraging blockchain technology and token economics, it seeks to facilitate more transparent data flows between data owners, data providers and data consumers. \r\n\r\nUltimately, it aims to return data ownership back to data owners, provide applications with tools to collect and monetize data legitimately, and allow data consumers to purchase explicitly consented data with an auditable source of provenance for their business intelligence, research, and targeted marketing purposes.','https://assets.coingecko.com/coins/images/4393/thumb/airbloc-protocol-logo.png?1547039734','https://assets.coingecko.com/coins/images/4393/small/airbloc-protocol-logo.png?1547039734','https://assets.coingecko.com/coins/images/4393/large/airbloc-protocol-logo.png?1547039734','2021-03-22 22:12:51'),(119,'aircoins',0,676,10000000000,'Augmented Reality (AR) and blockchain applications are leading the next technology revolution. The cryptocurrency market will reach $1 Trillion marketcap. Aircoins aims to unlock the digital ecosystem with hidden treasures for you to unlock in the AR environment. Be able to pickup, drop and trade cryptos in AR.','https://assets.coingecko.com/coins/images/9201/thumb/Aircoins.png?1591615033','https://assets.coingecko.com/coins/images/9201/small/Aircoins.png?1591615033','https://assets.coingecko.com/coins/images/9201/large/Aircoins.png?1591615033','2021-03-22 22:12:52'),(120,'airswap',90255553,18195099,500000000,'AirSwap is a decentralized token exchange based on the Swap protocol whitepaper. Swap provides a decentralized trading solution based on a peer-to-peer design. The design solves two problems encountered in a peer-to-peer trading environment: counterparty discovery and pricing suggestions.','https://assets.coingecko.com/coins/images/1019/thumb/AST.png?1547034939','https://assets.coingecko.com/coins/images/1019/small/AST.png?1547034939','https://assets.coingecko.com/coins/images/1019/large/AST.png?1547034939','2021-03-22 22:12:52'),(121,'aisf',0,11,3000000000,'Smart Farm, which is developed by combining ICT and robot science and technology such as big data, artificial intelligence, and internet is trending in Korea and abroad as one of the measures to cope with changes in agriculture due to climate change and solve rural and agricultural problems. Smart Farm is develops and distributes models, develops R&D projects, and expands domestic and overseas markets continuously, enabling production and demand prediction in the market through collecting data on crop growth and AI-based ana