c liquidity and treasury management.\r\n\r\nOur first product, Sparta, allows taking undercollateralized loans (borrower provides only 50% of collateral), as well as to passively generate yield via integrated yield rebalancer to get maximum available APR from different DeFi protocols. All funds are pooled, and the internal economy is based on a bonding curve, which provides additional incentives to the users.\r\n\r\nOur second product is Delphi, a yield farming aggregator with dollar cost averaging tooling. Delphi allows users to gain yield on synthetic savings, farm tokens from integrated protocols/pools, and invest in volatile assets using an active “all in” approach or a passive dollar cost averaging strategy.','https://assets.coingecko.com/coins/images/3328/thumb/Akropolis.png?1547037929','https://assets.coingecko.com/coins/images/3328/small/Akropolis.png?1547037929','https://assets.coingecko.com/coins/images/3328/large/Akropolis.png?1547037929','2021-03-22 22:12:54'),(129,'akropolis-delphi',3045226,332562,30000000,'','https://assets.coingecko.com/coins/images/12300/thumb/adel_on_white_10x.png?1598967061','https://assets.coingecko.com/coins/images/12300/small/adel_on_white_10x.png?1598967061','https://assets.coingecko.com/coins/images/12300/large/adel_on_white_10x.png?1598967061','2021-03-22 22:12:55'),(130,'aladdin-galaxy',0,194,8800000000,'Aladdin Galaxy is not only a secure storage system but also a system that value can be exchanged cross the chain.\r\n\r\nBe based upon secure storage and cross-chain conversion, Aladdin Galaxy is building a future value management system.','https://assets.coingecko.com/coins/images/7072/thumb/RkOyyrDYGb4IKvc0b_eLI8CtTqBqi_VM3fZoZ3UzH9pxjMW7xePYBDUvDdOY1zDJ6x-L0JRE4JQFXr5RAjJ8KCHUFlrK0fseuMslSi7ngbbuM3kC1geTI37ibDoRRllFtuQdw380DE0Bsg96pz_yTKRjOgdCyYxlp_hDFK33wIEyr-b_SqbkC1cGx45j-GbJP06XryNx5CXFpHe2Y5M0F9IPkvS9p7MjdQtzvzAo-EkLIiUH.jpg?1547043535','https://assets.coingecko.com/coins/images/7072/small/RkOyyrDYGb4IKvc0b_eLI8CtTqB