7','2021-03-22 22:12:56'),(133,'albos',0,38,28710000000,'Albos ensures the timeliness and security of settlement in blockchain\r\nas well as the acceleration of funds in settlement.\r\nFor cryptocurrencies to become part of the global infrastructure used\r\nin todays societies, more actual demand needs to be created by making\r\ncryptocurrencies a tool for payments and money transfers that improves peoples lives.','https://assets.coingecko.com/coins/images/7553/thumb/albos.jpg?1548757026','https://assets.coingecko.com/coins/images/7553/small/albos.jpg?1548757026','https://assets.coingecko.com/coins/images/7553/large/albos.jpg?1548757026','2021-03-22 22:12:56'),(134,'alchemint',144685,106,1000000000,'Alchemint uses smart contract to allow distributed creations of sdusd (a kind of stablecoin dynamically pegged to USD) with the collateralization of various crypto-assets, as backed by a set of mechanism that secures the stability of sdusd’s value. Popular digital currencies, such as BTC, ETH and NEO, are unable to become means of payment as a result of their huge price volatility, which to a large extent impedes the current blockchain projects getting down to earth.  \r\n\r\nHaving all the characteristics of crypto-currency, sdusd is additionally able to keep its own value stable.  Being user-friendly, sdusd can be sent to others, used to settle prices for goods and services or held as long-term saving.  Sdusd will also serve as an essential medium of exchange for crypto-currency trading platforms. \r\n\r\nInitially, Alchemint’s platform supports one single type of asset to be collateralized, which is NEO.  Subsequently, Alchemint will embrace assorted collateral assets and accept the reserve and mortgage of tokenized traditional assets, such as gold, real estate, fund units and etc., with a view to meeting consumer grade liquidity needs for stablecoins. \r\n\r\nDown the road, sdusd will grow into an important value transmission tool for blockchain-based appli-cations and be applied to various business scenarios.  In addition, sdusd will provide users with expe-rience of freedom, fairness and swiftness in the Internet world and build up a more efficient business development system with lower costs for crypto start-ups to boom.','https://assets.coingecko.com/coins/images/3324/thumb/Logo_%282%29.jpg?1547037925','https://assets.coingecko.com/coins/images/3324/small/Logo_%282%29.jpg?1547037925','https://assets.coingecko.com/coins/images/3324/large/Logo_%282%29.jpg?1547037925','2021-03-22 22:12:57'),(135,'alchemix',160267139,10766387,1019698,'Alchemix token is the governance token for the Alchemix protocol. ','https://assets.coingecko.com/coins/images/14113/thumb/Alchemix.png?1614409874','https://assets.coingecko.com/coins/images/14113/small/Alchemix.png?1614409874','https://assets.coingecko.com/coins/images/14113/large/Alchemix.png?1614409874','2021-03-22 22:12:57'),(136,'alchemix-usd',0,166,217850809,'alUSD is a yield-backed synthetic stablecoin powered by the Alchemix protocol','https://assets.coingecko.com/coins/images/14114/thumb/Alchemix_USD.png?1614410406','https://assets.coingecko.com/coins/images/14114/small/Alchemix_USD.png?1614410406','https://assets.coingecko.com/coins/images/14114/large/Alchemix_USD.png?1614410406','2021-03-22 22:12:57'),(137,'alchemy-pay',14409481,6513540,10000000000,'Alchemy Pay (Alchemy) is a blockchain project founded by a team of seasoned payments professional in the traditional finance space to tackle the inefficiencies of the traditional payment ecosystem such as fraud and human errors during reconciliation and settlement phases as well as a cluttered payment solutions.\r\n\r\nAlchemy pioneered an all-in-one hybrid fiat and crypto payments system for businesses which can be deployed in any existing mainstream systems, be it offline (POS, payment terminals, mobile devices etc.), online or in-app to accept payments via fiat mobile wallets, cryptocurrencies and credit cards. The hybrid system leverages