end, the signal dictates adding to the trading position.\r\n\r\nIf price breaches below a bearish fractal during a bullish trend, the signal dictates a stop loss trigger. \r\n\r\nThese entry or exit triggers occur after a candle close for the period. The candle body must close above or below the fractal of the prior period to satisfy the trade trigger condition.','https://assets.coingecko.com/coins/images/11653/thumb/alligator_fractal_set.png?1592325151','https://assets.coingecko.com/coins/images/11653/small/alligator_fractal_set.png?1592325151','https://assets.coingecko.com/coins/images/11653/large/alligator_fractal_set.png?1592325151','2021-03-22 22:13:29'),(154,'allive',308521,4876,6000000000,'ALLIVE is an intelligent, blockchain-based healthcare ecosystem. At ALLIVE, users have complete control over their own health data, which can be analyzed by the AI doctor to provide a personalized, comprehensive healthcare management.','https://assets.coingecko.com/coins/images/8405/thumb/Allive.jpg?1557991017','https://assets.coingecko.com/coins/images/8405/small/Allive.jpg?1557991017','https://assets.coingecko.com/coins/images/8405/large/Allive.jpg?1557991017','2021-03-22 22:13:30'),(155,'allohash',0,215548,180000000,'What Is AlloHash ?\r\n\r\nAlloHash is a Centralized application platform that enables users to Send, Receive, Swap ... Cryptocurrencies without Internet Connections. The platform enables users to use SMS or Phone Calls instead of the internet, in order to trade cryptocurrencies. There are no personal or account details that are required.\r\n\r\nThe platform will be of great use to people who would like to carry out an urgent transaction but there is no internet signal. AlloHash also provides its users with a solution for the long confirmation process and the high fees.\r\n\r\nAlloHash is the native utility token that is used for:\r\n\r\nTopup Your virtual phone Balance to Receive & Send Text or make a call via online Apps.\r\nBy virtual Numbers and use it as